Opis:
Wyremontowane mieszkanie o powierzchni 30 metrów kwadratowych znajduje się na 3 pietrze w bloku z windą.
Wykonane prace obejmowały: 
Wymianę podłóg;
Wycyklinowanie podłogi;
Postawienie dwóch ścian;
Wyposażenie kuchni w nowe szafki oraz sprzęt;
Wymianę instalacji;
Nowe płytki, ceramika, armatura oraz...

Na sprzedaż 2-pokojowe mieszkanie 46m2, piętro 1/9 z windą, w budynku z 1977r., Bielany Chomiczówka.
Do odświeżenia lub remontu, doskonałe dla rodziny lub pary, także inwestycyjnie pod wynajem.
Mieszkanie to:
* salon z wyjściem na balkon;
* sypialnia;
* oddzielna kuchnia z oknem: lodówka, płyta gazo...
